import React from 'react';
import { NavLink } from 'react-router-dom';
const web = 'https://thumbs.dreamstime.com/z/grow-your-business-words-office-table-computer-coffee-notepad-smartphone-digital-tablet-66818060.jpg'

const Card = (props) => {
     return (
          <>
               <div className='col-md-4 col-10 mx-auto'>
                    <div class="card" >
                         <img src={web} class="card-img-top" alt="..." />
                         <div class="card-body">
                              <h5 class="card-title">Card title</h5>
                              <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                              <NavLink to="" class="btn btn-primary">Go somewhere</NavLink>
                         </div>
                       </div>
                    </div>
          </>
     )
}

export default Card;
